import Web from "../src/Images/seo.png";
import digital from "../src/Images/digital.png";
import software from "../src/Images/software.png";

const Sdata = [

    {
        
        imgsrc : Web,
        title : "web Developement",
        info : "We Have developed so many websites",
    },
    {
      
        imgsrc : digital,
        title : "Digital Marketing",
        info:"We are also do Digital Marketing",
    },
    {
        
        imgsrc : software,
        title : "Software Developer",
        info : "Our team is expert in software Development",
    }

];


export default Sdata;
